INSERT INTO `v1_8b5eb77a33173a1c9345a8726ab916378c50845e72b7e60c8ec4ce06392285dc` VALUES (1, 0, 0, 1.5, 1, 1, 160, "仲間と夏を楽しむ、夏海の魔法士。自分を変えたいという固い決意で、障害物を無効化して走り続ける。", 122601, 0.029, 1, 105, 101, 110);
INSERT INTO `v1_8b5eb77a33173a1c9345a8726ab916378c50845e72b7e60c8ec4ce06392285dc` VALUES (0, 0, 1, 2.5, 2, 3, 120, "太陽よりも輝く、夏海の元気娘。　持ち前の身体能力で、どんなコースも柔軟に対応し、駆け抜ける。", 122401, 0.014, 2, 111, 102, 105);
INSERT INTO `v1_8b5eb77a33173a1c9345a8726ab916378c50845e72b7e60c8ec4ce06392285dc` VALUES (0, 1, 0, 2.5, 3, 2, 350, "波打ち際に煌めく、夏海の剣士。　日々の鍛錬で鍛えた脚で、長い距離も速度を落とさず走り切る。", 122501, 0.017, 3, 105, 103, 110);
INSERT INTO `v1_8b5eb77a33173a1c9345a8726ab916378c50845e72b7e60c8ec4ce06392285dc` VALUES (0, 0, 1, 1.5, 4, 3, 130, "海の幸に目がない、渚のお姫様。　『王家の装備』の力を解放し、障害物をものともせず前へと進む。", 107501, 0.016, 4, 105, 104, 110);
INSERT INTO `v1_8b5eb77a33173a1c9345a8726ab916378c50845e72b7e60c8ec4ce06392285dc` VALUES (1, 0, 0, 2.5, 5, 1, 160, "海でも主さまをお世話する、白浜の巫女。精霊の力で自身を加速させ、誰よりも速くゴールを目指す。", 107601, 0.014, 5, 105, 105, 110);
INSERT INTO `v1_8b5eb77a33173a1c9345a8726ab916378c50845e72b7e60c8ec4ce06392285dc` VALUES (0, 1, 0, 3.5, 6, 2, 255, "水着姿を恥じらう、ツンデレ猫娘。お得意の魔法で、対戦相手の走りを妨害し、レースを有利に進める。", 107801, 0.029, 6, 103, 106, 120);
INSERT INTO `v1_8b5eb77a33173a1c9345a8726ab916378c50845e72b7e60c8ec4ce06392285dc` VALUES (1, 0, 0, 3.5, 7, 1, 160, "優雅に浜を駆ける、真夏のマホ姫。しゃなりしゃなりと、雅な身のこなしで障害物を跳び越えていく。", 110601, 0.013, 7, 103, 107, 120);
INSERT INTO `v1_8b5eb77a33173a1c9345a8726ab916378c50845e72b7e60c8ec4ce06392285dc` VALUES (0, 1, 0, 2.5, 8, 2, 350, "浜の平和を守る、真夏の狼娘。　　獣人の強靭なスタミナで、レース　後半にスパートをかける。", 110401, 0.014, 8, 103, 108, 110);
INSERT INTO `v1_8b5eb77a33173a1c9345a8726ab916378c50845e72b7e60c8ec4ce06392285dc` VALUES (0, 0, 1, 1.5, 9, 3, 130, "浜に力強く舞う、真夏の南国娘。　レースの喧噪の中でも精神を乱さず後半に大きな捲りを見せる。", 110501, 0.012, 9, 100, 109, 105);
INSERT INTO `v1_8b5eb77a33173a1c9345a8726ab916378c50845e72b7e60c8ec4ce06392285dc` VALUES (1, 0, 0, 2.5, 10, 1, 200, "浜の事件を嗅ぎ付けた、真夏の　　名探偵。高い推理力と魔法で、的確に対戦相手の走りを乱す。", 115701, 0.014, 10, 103, 110, 105);
INSERT INTO `v1_8b5eb77a33173a1c9345a8726ab916378c50845e72b7e60c8ec4ce06392285dc` VALUES (0, 1, 0, 2.5, 11, 2, 350, "再び鎧を脱いだ、灼熱の騎士団長。実戦で培った判断力で、瞬時にバリアを展開し、障害物を無力化する。", 113601, 0.071, 11, 103, 111, 105);
INSERT INTO `v1_8b5eb77a33173a1c9345a8726ab916378c50845e72b7e60c8ec4ce06392285dc` VALUES (0, 0, 1, 1.5, 12, 3, 130, "水が苦手な、海辺の気まぐれ猫娘。浜に現れた美少女義賊は、対戦相手のスピードを奪いとる。", 107901, 0.014, 12, 103, 112, 120);
INSERT INTO `v1_8b5eb77a33173a1c9345a8726ab916378c50845e72b7e60c8ec4ce06392285dc` VALUES (1, 0, 0, 1.5, 13, 2, 200, "バカンスも効率第一な、海の傭兵。レースでも最高効率を求め、どんな状況でも隙のない走りを見せる。", 108001, 0.022, 13, 105, 113, 110);
INSERT INTO `v1_8b5eb77a33173a1c9345a8726ab916378c50845e72b7e60c8ec4ce06392285dc` VALUES (1, 0, 0, 2.5, 14, 1, 160, "真夏の太陽が良く似合う、海辺の　サレンママ。多才で器用、どんな　障害物もエレガントに越えていく。", 110301, 0.031, 14, 108, 114, 110);
INSERT INTO `v1_8b5eb77a33173a1c9345a8726ab916378c50845e72b7e60c8ec4ce06392285dc` VALUES (0, 0, 1, 0.5, 15, 1, 130, "海に嵐を呼ぶ夏のドジっ娘メイド。日頃から災難に慣れており、多少　のトラブルには動じたりしない。", 107701, 0.036, 15, 105, 115, 110);
INSERT INTO `v1_8b5eb77a33173a1c9345a8726ab916378c50845e72b7e60c8ec4ce06392285dc` VALUES (0, 1, 0, 3.5, 16, 2, 350, "粋な夏を愉しむ、若夏の姉御。　　流麗な身体捌きで、始・継・終と、UBを重ねるごとに、加速する。", 113101, 0.048, 16, 95, 116, 110);
INSERT INTO `v1_8b5eb77a33173a1c9345a8726ab916378c50845e72b7e60c8ec4ce06392285dc` VALUES (0, 0, 1, 1.5, 17, 3, 130, "夏のトキメキに触れた、オタク魔法少女。多彩な魔法を操り、少しずつ他の走者の速度を落とし続ける。", 113301, 0.043, 17, 105, 117, 105);
INSERT INTO `v1_8b5eb77a33173a1c9345a8726ab916378c50845e72b7e60c8ec4ce06392285dc` VALUES (0, 0, 1, 1.5, 18, 2, 130, "海獄に降臨せし、真夏の冥姫。　　レース後半に魔力を全解放し、　　蒼き疾風と成りて浜を駆け抜ける。", 113201, 0.018, 18, 95, 118, 105);
INSERT INTO `v1_8b5eb77a33173a1c9345a8726ab916378c50845e72b7e60c8ec4ce06392285dc` VALUES (1, 0, 0, 2.5, 19, 2, 160, "夏の夕を火花で彩る、渚の壊し屋。『壊し屋』の異名と過激な愛情は、対戦相手にプレッシャーを与える。", 117001, 0.021, 19, 108, 119, 110);
INSERT INTO `v1_8b5eb77a33173a1c9345a8726ab916378c50845e72b7e60c8ec4ce06392285dc` VALUES (0, 1, 0, 2.5, 20, 1, 255, "青春に生きる者を導く、夏の先生。夢へと邁進する聖母の加護が、その身をあらゆる困難から守る。", 113501, 0.036, 20, 105, 120, 110);
INSERT INTO `v1_8b5eb77a33173a1c9345a8726ab916378c50845e72b7e60c8ec4ce06392285dc` VALUES (0, 1, 0, 2.5, 21, 3, 350, "笑顔の応援が眩しい、夏の超能力　ガール。超能力を駆使して、どんな障害物もひとっ飛びで乗り越える。", 113401, 0.02, 21, 105, 121, 105);
INSERT INTO `v1_8b5eb77a33173a1c9345a8726ab916378c50845e72b7e60c8ec4ce06392285dc` VALUES (0, 0, 1, 2.5, 22, 1, 130, "海辺で大人の魅力を放つ、夏の　　セクシー先生。その魅力に囚われた対戦相手は、走りを乱してしまう。", 110101, 0.018, 22, 105, 122, 110);
INSERT INTO `v1_8b5eb77a33173a1c9345a8726ab916378c50845e72b7e60c8ec4ce06392285dc` VALUES (1, 0, 0, 3.5, 23, 3, 160, "水着も絶対外さない、夏のカリスマモデル。走りのバイブスは超テンアゲで、スピードはおにやば。", 110001, 0.03, 23, 111, 123, 105);
INSERT INTO `v1_8b5eb77a33173a1c9345a8726ab916378c50845e72b7e60c8ec4ce06392285dc` VALUES (0, 0, 1, 1.5, 24, 1, 130, "南の島も盛り上げる、真夏のアイドル。悪天候でも笑顔を絶やさず後半もリズムを上げて走り切る。", 117201, 0.027, 24, 103, 124, 110);
INSERT INTO `v1_8b5eb77a33173a1c9345a8726ab916378c50845e72b7e60c8ec4ce06392285dc` VALUES (1, 0, 0, 3.5, 25, 2, 160, "海原に美声を響かす、渚の歌姫。　守護の賛歌と精霊の加護により、　障害物から身を守る。", 117301, 0.02, 25, 108, 125, 105);
INSERT INTO `v1_8b5eb77a33173a1c9345a8726ab916378c50845e72b7e60c8ec4ce06392285dc` VALUES (0, 1, 0, 2.5, 26, 3, 350, "夏でも天邪鬼な、夕凪のテーラー。張り巡らされた魔法の糸で、他の走者の自由を奪う。", 117401, 0.04, 26, 105, 126, 110);
INSERT INTO `v1_8b5eb77a33173a1c9345a8726ab916378c50845e72b7e60c8ec4ce06392285dc` VALUES (0, 1, 0, 3.5, 27, 1, 350, "向日葵が良く似合う、海辺の　　　お姉ちゃん。秘密結社の一員で、　抜群の身体能力が一番の武器。", 117101, 0.009, 27, 105, 127, 110);
INSERT INTO `v1_8b5eb77a33173a1c9345a8726ab916378c50845e72b7e60c8ec4ce06392285dc` VALUES (0, 1, 0, 3.5, 28, 1, 255, "渚でおっとり、夏色うさぎっこ。　うさぎさんパワー全開で、ぴょん　ぴょんとコースを跳ね回る。", 122901, 0.022, 28, 105, 128, 120);
INSERT INTO `v1_8b5eb77a33173a1c9345a8726ab916378c50845e72b7e60c8ec4ce06392285dc` VALUES (0, 0, 1, 2.5, 29, 3, 130, "無邪気さ弾ける、夏色いたずら娘。砂浜でも、いたずらの準備は万端！レースに大波乱が巻き起こる！？", 122801, 0.028, 29, 105, 129, 110);
INSERT INTO `v1_8b5eb77a33173a1c9345a8726ab916378c50845e72b7e60c8ec4ce06392285dc` VALUES (1, 0, 0, 3.5, 30, 2, 130, "海でも真面目な、夏色優等生。　　高めた魔力を解き放ち、一瞬の内に他の走者を置き去りにする。", 122701, 0.023, 30, 108, 130, 105);
